import React, { useState } from "react";
import "./Cont.scss";

import { makeStyles } from "@material-ui/core/styles";
import { TextField } from "@material-ui/core";
import Button from "@material-ui/core/Button";

import WhatsAppIcon from "@material-ui/icons/WhatsApp";
import MailOutlineIcon from "@material-ui/icons/MailOutline";
import GitHubIcon from "@material-ui/icons/GitHub";
import MobileCont from "./MobileCont";

const Style = makeStyles({
  btn: {
    margin: "0.5rem 0",
    width: "20%",
    background: "red",
    height: "3rem",
    color: "#fff",
    position: "relative",

    float: "right",
    "&:hover": {
      color: "red",
      transition: ".5s ease-in-out",
    },
  },
  btnn: {
    margin: "0.5rem 0",
    width: "100%",
    background: "white",
    color: "black",
    border: "1px solid #8a8686",
    height: "3rem",
    textTransform: "none",
    // color: "#fff",
    "&:hover": {
      // color: "red",
      transition: ".5s ease-in-out",
    },
  },
});

const Cont = () => {
  const classes = Style();
  const [Fullname , useFullNme] = useState({
    FName: "",
    LName: "",
    Email: "",
    Mesg: "",
  });

  const InputEvent = (event) =>{
    console.log(event.target.value);

    const {value , name} =event.target;

    useFullNme((pValue)=>{
      return{
        ...pValue,
        [name]: value,

      };
    });
  };
  const onSubmit = (event)=>{
    event.preventDefault();
    alert("Your Query has been submitted sucessfully")
  };


  const savecont = ()=>{
    console.log("YOu First name is =" , Fullname.FName ,
    "YOu First name is =" , Fullname.FName ,
    "YOu First name is =" , Fullname.FName ,
    "YOu First name is =" , Fullname.FName
    
    )
  }
  return (
    <>
    <form onSubmit = {onSubmit}>
      <div className="Central_div_main">
        <div className="Middle_div">
          <span className="cont_contact">CONTACT US</span>

          <div className="inputs">
            <TextField
            type="text"
              name="FName"
              label="First Name"
              variant="outlined"
              onChange={InputEvent}
              value={Fullname.FName}
              style={{ width: "100%", marginRight: "23px" , marginBottom: "5px" }}
            />

            <TextField
              name= 'LName'
              type="text"
              id="outlined-basic"
              label="Last Name"
              onChange={InputEvent}
              value={Fullname.LName}
              variant="outlined"
              style={{ width: "100%", marginRight: "2%" }}
            />

            <TextField
              name="Email"
              type="email"
              id="outlined-basic"
              label="Email Adress"
              onChange={InputEvent}
              value={Fullname.Email}
              variant="outlined"
              style={{ width: "100%", marginRight: "2%", color: "black" }}
            />
          </div>

          <div className="textfield">
            <TextField
              name= "mesg"
              id="outlined-multiline-static"
              label="Entre Your Text Here"
              onChange={InputEvent}
              value={Fullname.mesg}
              multiline
              rows={10}
              style={{ width: "100%", marginTop: "2%" }}
              variant="outlined"
            />
          </div>

          <div className="button" >
            <Button onClick={savecont} id = 'materialbtn4' variant="contained" type="submit" className={classes.btn}>
              SIGN UP
            </Button>
          </div>

          <div className="Contact_button" >
            <Button id="materialbtn1" variant="contained" className={classes.btnn}>
              <GitHubIcon />
              &nbsp;&nbsp;&nbsp; Zendesk
            </Button>
            <Button id="materialbtn2" variant="contained" className={classes.btnn}>
              <WhatsAppIcon />
              &nbsp;&nbsp;&nbsp;&nbsp; +923********
            </Button>
            <Button id="materialbtn3" variant="contained" className={classes.btnn}>
              <MailOutlineIcon />
              &nbsp;&nbsp;&nbsp;&nbsp; @instaprint.pk
            </Button>
          </div>
        </div>
      </div>

      <div className="mbl_cont">
        <MobileCont/>
      </div>
      </form>
    </>
  );
};

export default Cont;
